import pdfMake from 'pdfmake/build/pdfmake'
import pdfFonts from 'pdfmake/build/vfs_fonts'
pdfMake.vfs = pdfFonts.pdfMake.vfs

export default {
  data () {
    return {
      chart: {}
    }
  },
  methods: {
    pdfExport (items) {
      const colsHeaders = this.extractHeaders(Object.keys(items[0]))
      const rows = this.extractValues(items)
      const chartImage = this.extractGraphicImage()
      const headerImage = this.headerImageBase64()
      rows.unshift(colsHeaders)

      const docDefinition = {
        content: [
          {
            columns: [
              {
                image: headerImage,
                fit: [80, 80],
                width: '*'
              },
              {
                text: 'Centro de DirecciÃ³n Nacional',
                width: '*',
                style: 'pageHeaderCenter'
              },
              {
                text: [
                  {
                    text: 'Oficina Central\nCalle 23 No. 105, e/ O y P\nVedado, Plaza, La Habana',
                    style: 'pageHeaderRight'
                  }
                ],
                width: '*'
              }
            ]
          },
          {
            text: '_______________________________________________________________________________________________'
          },
          {
            text: this.reportName,
            style: 'header'
          },
          {
            margin: 5,
            table: {
              headerRows: 1,
              body: rows
            }
          },
          {
            image: chartImage,
            width: 480,
            height: 200,
            margin: 5
          }
        ],
        styles: {
          header: {
            fontSize: 18,
            bold: true,
            alignment: 'center',
            margin: 5
          },
          tableHeader: {
            bold: true,
            alignment: 'center'
          },
          tableBody: {
            alignment: 'center'
          },
          pageHeaderRight: {
            fontSize: 10,
            alignment: 'right'
          },
          pageHeaderCenter: {
            alignment: 'center',
            fontSize: 18,
            bold: true
          }
        }
      }
      // console.log(rows)

      pdfMake.createPdf(docDefinition).download(this.reportName)
    },

    extractHeaders (headers) {
      return headers.map(header => {
        return {
          text: header,
          style: 'tableHeader'
        }
      })
    },

    extractValues (items) {
      const values = []
      items.forEach(item => {
        values.push(Object.values(item))
      })
      return this.stylingValues(values)
    },

    stylingValues (rows) {
      return rows.map(row => this.stylingRow(row))
    },

    stylingRow (row) {
      return row.map(value => {
        return {
          text: value,
          style: 'tableBody'
        }
      })
    },

    extractGraphicImage () {
      return this.$data.chart.toBase64Image()
    },

    headerImageBase64 () {
      return 'data:image/png;base64,'
    }
  }
}
